  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a White-faced Ibis
  study that was conducted on Benton Lake NWR during 1996. The objectives were to
  document the number of breeding pairs on the Refuge and to determine White-faced
  Ibis nesting chronology; i.e., dates of egg laying, hatching, and fledging. This
  report summarizes the study area, methods, results, and recommendations for future
  studies. Field data sheets, a diagram of the egg float test, and nest data sheets
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
